    const { scrollYProgress } = useScroll();
    const x = useTransform(scrollYProgress,[0,1],[0,-900]);
    // const x = useTransform(scrollYProgress,[1,0],[0,-900]);

  return (

      <div>
        <div>
              <motion.h1 style={{x}} className='m m1'>DEVELOPER DESIGNER DEVELOPER</motion.h1>
        </div>

        <div>
              <motion.h1 style={-{x}}className='m m2'>DESIGNER DEVELOPER DESIGNER </motion.h1>
        </div>
      </div>
  )
}

export default Moving
